import React, { useState } from 'react';
import { motion } from 'framer-motion';

const SupabaseTest = () => {
  const [status, setStatus] = useState('Ready to test');
  const [error, setError] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const testConnection = async () => {
    setIsLoading(true);
    setError(null);
    setStatus('Testing connection...');

    try {
      // Simple test - just try to import the config
      const config = await import('../../config/supabase');
      console.log('Supabase config loaded:', config);
      
      setStatus('‚úÖ Config loaded successfully!');
      
      // Try a simple database call
      const { dbHelpers } = config;
      const result = await dbHelpers.getAllSubmissions();
      
      if (result.error) {
        throw new Error(result.error.message);
      }
      
      setStatus(`‚úÖ Connected! Found ${result.data?.length || 0} submissions`);
      
    } catch (err) {
      console.error('Test error:', err);
      setStatus('‚ùå Connection failed');
      setError(err.message || 'Unknown error');
    } finally {
      setIsLoading(false);
    }
  };

  const testCreateFarmer = async () => {
    setIsLoading(true);
    setError(null);

    try {
      const config = await import('../../config/supabase');
      const { dbHelpers } = config;
      
      const newFarmer = {
        phone_number: '9999999999',
        name: 'Test Farmer',
        location: 'Test Location',
        language: 'en'
      };

      const result = await dbHelpers.createFarmer(newFarmer);
      
      if (result.error) {
        throw new Error(result.error.message);
      }
      
      alert('‚úÖ Test farmer created successfully!');
      testConnection(); // Refresh status
      
    } catch (err) {
      console.error('Create farmer error:', err);
      alert('‚ùå Error: ' + (err.message || 'Unknown error'));
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-green-50 to-blue-50 p-6">
      <div className="max-w-4xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="bg-white rounded-2xl shadow-xl p-8"
        >
          <h1 className="text-3xl font-bold text-gray-900 mb-6 text-center">
            üß™ Supabase Connection Test
          </h1>

          {/* Status Display */}
          <div className="mb-8 p-6 bg-gray-50 rounded-xl">
            <h2 className="text-xl font-semibold mb-4">Connection Status</h2>
            <div className="text-2xl font-bold mb-2">{status}</div>
            {error && (
              <div className="text-red-600 bg-red-50 p-4 rounded-lg">
                <strong>Error:</strong> {error}
              </div>
            )}
            {isLoading && (
              <div className="text-blue-600 bg-blue-50 p-4 rounded-lg">
                <strong>Loading...</strong> Please wait...
              </div>
            )}
          </div>

          {/* Test Buttons */}
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-8">
            <button
              onClick={testConnection}
              disabled={isLoading}
              className="bg-blue-600 text-white py-3 px-6 rounded-lg font-medium hover:bg-blue-700 transition-colors disabled:opacity-50 disabled:cursor-not-allowed"
            >
              {isLoading ? '‚è≥ Testing...' : 'üîó Test Connection'}
            </button>
            <button
              onClick={testCreateFarmer}
              disabled={isLoading}
              className="bg-green-600 text-white py-3 px-6 rounded-lg font-medium hover:bg-green-700 transition-colors disabled:opacity-50 disabled:cursor-not-allowed"
            >
              {isLoading ? '‚è≥ Creating...' : 'üßë‚Äçüåæ Test Create Farmer'}
            </button>
          </div>

          {/* Instructions */}
          <div className="p-6 bg-yellow-50 rounded-xl mb-6">
            <h2 className="text-xl font-semibold mb-4">üìã How to Test</h2>
            <div className="space-y-2 text-sm">
              <div>1. Click "Test Connection" to check Supabase connection</div>
              <div>2. Look for "‚úÖ Connected!" message</div>
              <div>3. Click "Test Create Farmer" to add test data</div>
              <div>4. Check your Supabase dashboard for new data</div>
            </div>
          </div>

          {/* Troubleshooting */}
          <div className="p-6 bg-red-50 rounded-xl">
            <h2 className="text-xl font-semibold mb-4 text-red-800">üîß Troubleshooting</h2>
            <div className="space-y-2 text-sm text-red-700">
              <div>‚Ä¢ Check browser console (F12) for detailed errors</div>
              <div>‚Ä¢ Verify Supabase URL and key in src/config/supabase.js</div>
              <div>‚Ä¢ Make sure you ran the SQL schema in Supabase</div>
              <div>‚Ä¢ Check if your Supabase project is active</div>
            </div>
          </div>

          {/* Back Button */}
          <div className="mt-6 text-center">
            <button
              onClick={() => window.history.back()}
              className="bg-gray-600 text-white py-2 px-6 rounded-lg font-medium hover:bg-gray-700 transition-colors"
            >
              ‚Üê Back to Home
            </button>
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default SupabaseTest;
